(898, 'ok-v05WiVuERal41Oi-k6PyUvC1Q', '', '深度学习高端人才不仅是 AI 发展的重要养分，也是企业转型 AI 巨大推动力。2019年1月19日，百度黄埔学院——深度学习架构师培养计划在百度科技园举行开学典礼，深度学习技术及应用国家工程实验室副主任、百度 AI 技术平台体系执行总监吴甜，中国信息通信研究院副总工史德年，中国软件行业协会常务副秘书长陈宝国出席了典礼。吴甜表示，百度希望能帮助业界培养第一批“首席 AI 架构师”。\n\n35位来自业界的高端深度学习人才作为“黄埔学院”首期学员，迎来第一课，与20余位担当导师的百度重量级科学家和技术负责人享受“AI 知识盛宴”，中国深度学习第一核心技术圈初现雏形。\n \n\n\n 深度学习“人才荒” \n 培养稀缺人才正当时 \n\n近年来，中国的发展已经从高速增长向高质量发展转变，从粗放型增长向创新驱动增长转变，史德年表示，“在人工智能浪潮席卷全球的当下，深度学习作为核心技术，对于企业向 AI 转型的重要性不言而喻。”深度学习作为人工智能发展的重要一环，能让人工智能技术更快速地普及到各行各业，推动融合创新，推动经济、社会和文化等变革。', 'a:0:{}', '', '西安外国语大学', '', NULL, NULL, '¥', '', NULL, NULL, 'gg', 0, '', '论坛', '游戏', 0, 18, -17, '1547955893', '1547955893', '1'),
(899, 'ok-v05WiVuERal41Oi-k6PyUvC1Q', '', '此次表彰大会，上海证券交易所根据2018年市场机构债券及资产证券化承销与交易以及相关市场创新业务的参与情况，评选出了15项优秀参与机构奖。\n\n\n\n从2014年底资产证券化备案制开启至今，国内资产证券化市场呈现出了快速扩容、稳健运行的良好发展态势，截至2018年末，资产证券化产品累计发行规模已突破五万亿元，在国内固定收益市场中的占比不断提升，成为盘活存量、支持实体经济发展的重要金融工具。\n\n天风证券顺应市场发展趋势，对资产证券化业务高度重视，2018年天风证券作为管理人发行的资产证券化产品规模合计391.41亿元，自公司资产证券化业务起步以来两年半左右时间已完成多种类型资产证券化项目，累计发行规模为940亿元，排名行业前列。此次获奖，表明了交易所等监管机构对我司资产证券化业务助力固定收益市场服务实体经济能力的认可。\n\n天风证券在资产证券化细分领域表现突出。2016-2018年，公司作为计划管理人的不动产证券化产品（包括类REITs和CMBS）合计发行数量和规模均排名行业第一；2018年，融资租赁资产证券化产品发行数量和规模在交易所市场（含报价系统）中均排名第一。另外由天风证券作为计划管理人发行的运用了区块链技术的ABS产品共3支，发行数量排名国内券商第一，在金融科技与资产', 'a:0:{}', '', '西安外国语大学', '', NULL, NULL, '¥', '', NULL, NULL, 'gg', 0, '', '论坛', '游戏', 0, 3, 0, '1547979274', '1547979422', '0'),
